import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">

      <header className="App-header">
        <div class="form-group">
          <label class="col-form-label col-form-label-lg" for="inputLarge">
            User Input
          </label>
          <input class="form-control form-control-lg" type="text" placeholder="1" id="inputLarge"></input>
        </div>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Change <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
    </div>
  );
}

export default App;
